import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"

function RoadLevel6() {
    return (
        <div style = {{display:'flex',flexDirection:'column'}}>
            <div style = {{position:'relative', left:'45em'}}>
              <Road width={'10em'}
                height= {'3em'}
                StylingInfo = {'vertical-road'}/>
              <Road width={'10em'}
                height= {'10em'}
                StylingInfo = {'vertical-road'}
                dashType = {'vertical-dash'}/>
                   <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'vertical-road1'}
                  dashType = {'vertical-dashC'}/>
              <div style = {{display:'flex',flexDirection:'row', paddingRight:'20%', position:'relative'}}>
                <div style = {{position:'relative', bottom: '10em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', marginBottom: '30%', marginLeft: '-20em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>

              </div>
               
                
            </div>
        </div>
    )

}

export default RoadLevel6
